import React from 'react'
import Img from '.././general.png'

function AllExpenseDetails(props){
    function RenderMoney(){
        if(props.paid === "you paid "){
            return (
                <div className="all-expense-right">
                    <p className="">{props.paid}<br/> ${props.amount}</p>
                    <p className=""> {props.lent}{props.name} ${props.amount/2}</p>
                </div>
            )
        }
        else{
            return (
                <div className="all-expense-right">
                    <p className="">{props.name}{props.paid} ${props.amount}</p>
                    <p className="">{props.name} {props.lent} ${props.amount/2}</p>
                </div>
            )
        }
    }
    return(
        <div>
            <div className="all-expense">
                <div className="all-expense-left">
                    <p className="recent-activity-p-3">{props.monthOf}<br/>{props.dateOf}</p>
                    <img className="all-expense-img" src={Img} alt="poster-icon"/>
                    <p className="">{props.description}</p>
                </div>
                <RenderMoney/>
            </div>
        </div>
    )
}

export default AllExpenseDetails
